INSERT INTO `tbl_posts` (`posts_id`, `user_id`, `category_id`, `posts_judul`, `posts_isi`, `posts_image`, `posts_date`, `posts_time`, `posts_slug`, `posts_status`) VALUES
(8, 1, 5, 'Berantas Rokok Ilegal, Bea Cukai Luwuk dan Pemda Banggai Bangun Sinergi', '<p><img alt=\"\" src=\"https://scontent-sit4-1.xx.fbcdn.net/v/t1.0-9/38686090_247596485964291_1794419426255175680_n.jpg?_nc_cat=0&amp;oh=85a497d383a6b9cd955f15b72082f9a1&amp;oe=5C0195D5\" style=\"height:480px; width:640px\" /></p>\n\n<p><strong>Luwuk (13/08/2018) &ndash;</strong> Sebagai bentuk sinergi yang merupakan implementasi dari nilai-nilai Kementerian Keuangan, Bea Cukai Luwuk menerima kunjungan balasan dari Pemerintah Daerah Kabupaten Luwuk di Aula Kantor Bea Cukai Luwuk, pada Selasa (07/08). Hadir dalam kunjungan tersebut, Sekretaris Daerah Kabupaten Banggai Abdullah Ali, Staf Ahli Bupati Bidang Pelayanan Publik dan rekayasa Sosial Hasannudin Idris dan Kepala Bagian Administrasi Pembangunan Sekretaris Daerah Hasbullah. Sebelumnya, Kepala Kantor Bea Cukai Luwuk, Sigit Santosa beserta jajaran melakukan kunjungan kerja ke Kantor Sekretaris Daerah Banggai.</p>\n\n<p>&ldquo;Kepada perwakilan Pemerintah Daerah Kabupaten Luwuk kami menyampaikan perkembangan pelaksanaan tugas dan fungsi Bea Cukai di kabupaten Banggai, antara lain pelayanan impor, ekspor produk hasil laut, gas alam cair, dan terakhir ekspor amonia ke Australia. Demikian juga perkembangan pembangunan pabrik pengolahan udang untuk tujuan ekspor, serta rencana investasi sebuah perusahaan multinasional untuk mengolah kelapa dalam untuk tujuan ekspor,&rdquo; jelas Sigit Santosa.</p>\n\n<p>Bea Cukai Luwuk pun berkesempatan menyampaikan presentasi mengenai rokok ilegal, pengertian, jenis-jenis dan dampaknya jika rokok ilegal banyak beredar. &ldquo;Dapat disepakati bahwa perlu dilakukan tindak lanjut untuk melakukan kolaborasi bersama dalam upaya pencegahan rokok ilegal, salah satunya dengan memanfaatkan dana bagi hasil cukai hasil tembakau (DBHCHT). DBHCHT merupakan dana dari pungutan cukai yang ditransfer ke daerah, yang alokasinya selain untuk mengurangi dampak buruk merokok yaitu untuk meningkatkan kesehatan, juga untuk sosialisasi dan penegakan hukum terkait pemberantasan rokok ilegal.&rdquo;</p>\n\n<p>Sigit menyampaikan harapannya agar dengan adanya pertemuan ini bisa memberikan sumbangsih Bea Cukai Luwuk dalam proses pembangunan daerah, bersinergi dalam pemberantasan rokok ilegal yang akhirnya mampu meningkatkan penerimaan negara</p>\n', '', '2018-08-16', '12:44:50', 'berantas-rokok-ilegal-bea-cukai-luwuk-dan-pemda-banggai-bangun-sinergi', 1),
(9, 1, 3, 'Pecah!!! Customs Goes To Campus di Universitas Muhammadiyah Luwuk dihadiri 800-an peserta', '<p><strong>30 Agustus 2018 &ndash; Luwuk</strong></p>\n\n<p>Sebagai Instansi pemerintahan yang berada dibawah naungan Kementerian Keuangan, Bea Cukai berperan penting dalam membangun dan mendorong perekonomian negara. Disisi lain, masih banyak masyarakat luas yang tidak mengetahui apa itu bea cukai, apa saja fungsinya, dimana saja kerjanya dan masih banyak lagi yang berkaitan dengan Kepabeanan dan Cukai. Disinilah peran Penting Humas Bea Cukai untuk mensosialisasikan apa-apa saja yang terkait dengan Bea Cukai.&nbsp;Maka dari itu pada hari Kamis, 30 Agustus 2018 Bea Cukai Luwuk mengadakan kegiatan Customs Goes To Campus (CGTC) di Universitas Muhammadiyah Luwuk (Unismuh Luwuk).</p>\n\n<p>Dalam acara CGTC di Unismuh Luwuk dihadiri kurang lebih oleh 857 Mahasiswa Baru dan beberapa dosen. Bea Cukai Luwuk tidak menyia-nyiakan kesempatan ini untuk mensosialisakan tentang Bea Cukai setelah melihat antusiasme peserta.</p>\n\n<p>Dalam kesempatan ini Kepala Sub Seksi Penyuluhan Layanan Informasi Sulpikri selaku narasumber satu dan Pelaksana Pemeriksa Penindakan dan Penyikan Taruna Oktawijaya selaku narasumber dua menyampaikan Tugas dan fungsi Bea Cukai, rokok illegal, cukai vape, peraturan terbaru barang kiriman dan barang bawaan penumpang dari luar negeri. Tetunya dalam acara ini tidak hanya diisi dengan materi saja, namun juga kuis, sesi tanya jawab dan juga sesi foto Bersama.</p>\n\n<p>Dengan dilaksanakannya acara ini, diharapkan masyarakat luas khususnya para generasi muda bisa mengetahui tentang Bea Cukai serta perkembangan dari peraturan kepabeanan dan cukai.<img alt=\"\" src=\"https://scontent-sit4-1.xx.fbcdn.net/v/t1.0-9/40359308_266382200752386_5963582843777974272_n.jpg?_nc_cat=109&amp;oh=5c2d77135c31d411c3db963e127d8b1f&amp;oe=5C32A996\" style=\"border-style:solid; border-width:4px; float:left; height:200px; width:300px\" /><img alt=\"\" src=\"https://scontent-sit4-1.xx.fbcdn.net/v/t1.0-9/40376856_266381694085770_3068053821394518016_n.jpg?_nc_cat=110&amp;oh=7ca0bbe42951f81b6908db65054869ea&amp;oe=5C60BF9B\" style=\"border-style:solid; border-width:4px; height:174px; margin-left:160px; margin-right:160px; width:300px\" /><img alt=\"\" src=\"https://scontent-sit4-1.xx.fbcdn.net/v/t1.0-9/40406654_266382074085732_6968633709624819712_n.jpg?_nc_cat=100&amp;oh=a77760b7d270fcc0515f2214fc9ec543&amp;oe=5C619C43\" style=\"border-style:solid; border-width:4px; float:right; height:200px; width:300px\" /></p>\n', 'https://bcluwuk.com/upload/images/40374968_266381717419101_656874776446369792_n.jpg', '2018-09-19', '11:35:05', 'pecah-customs-goes-to-campus-di-universitas-muhammadiyah-luwuk-dihadiri-800-an-peserta', 1),
(10, 1, 3, 'Pelaksanaan Gathering Eksportir dan Pembentukan Klinik Ekspor', '<p><img alt=\"\" src=\"https://bcluwuk.com/upload/images/IMG_0068.JPG\" style=\"float:left; height:258px; margin:6px 9px; width:417px\" /><span style=\"font-size:18px\"><strong><em>Luwuk, 07 Nopember 2018.</em></strong></span></p>\n\n<p style=\"text-align:justify\"><em>Gathering </em>Eksportir dan pembentukan Klinik Ekspor dilaksanakan di kantor Bea Cukai Luwuk hari ini. Acara ini mengundang 8 perusahaan eksportir dan 2 calon eksportir, serta pihak Pemerintah Daerah Kab. Banggai dalam hal ini Dinas Perdagangan Kab. Banggai.</p>\n\n<p style=\"text-align:justify\">Tujuan diadakannya acara ini adalah untuk menindaklanjuti acara yang sama yang dilakukan pada tanggal 7 Agustus 2018 di Jakarta, yaitu <em>Gathering </em>Eksportir Indonesia dengan tema &quot;Fasilitas Fiskal untuk Peningkatan Ekspor Nasional&quot;. Sebagai salah satu fungsi fasilitasi perdagangan dan industri, Bea dan Cukai berusaha menyampaikan hal tesebut untuk menjaring industri berorientasi ekspor untuk dapat menggunakan fasilitas kepabeanan yang telah disediakan pemerintah dalam rangka peningkatan daya saing ekspor. Hal ini karena masih banyak yang belum mengetahui, khususnya KB (Kawasan Berikat) dan KITE (Kemudahan Impor Tujuan Ekspor). KB dan KITE adalah fasilitas dari pemerintah untuk mendukung usaha industri yang memerlukan bahan baku asal impor untuk diberikan pembebasan atau penangguhan jika barang hasil produksinya akan diekspor.</p>\n\n<p style=\"text-align:justify\">Dalam kesempatan itu juga disampaikan paparan mengenai fasilitas pengangkutan melalui Tol Laut oleh Kementerian Perhubungan, yang kebetulan pada saat ini sedang sandar kapal Kandhaga Nusantara 13 di pelabuhan Pagimana, yang diharapkan dapat mendukung pula sebagai pengumpan pengangkutan barang ekspor.</p>\n\n<p style=\"text-align:justify\">Dalam diskusi sempat mengemuka keluhan dari eksportir yang menyayangkan terjadinya demo buruh yang terjadi di pelabuhan Tangkiang, sehingga menimbulkan kerugian bagi pengusaha akibat terganggunya proses pengapalan barang ekspor dan impor, dan berharap agar permasalahan tersebut dapat segera diselesaikan oleh dinas yang berwenang.</p>\n\n<p style=\"text-align:justify\">Acara ditutup dengan harapan agar dapat bermanfaat bagi para eksportir dalam rangka menambah wawasan dan tentunya semakin membuka peluang untuk lebih memajukan usaha mereka serta kemajuan daerah dan kesejahteraan masyarakat.</p>\n\n<p style=\"text-align:justify\"><strong><big>#bea cukai makin baik</big></strong></p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bcluwuk.com/upload/images/WhatsApp%20Image%202018-11-07%20at%2013.58.32.jpeg\" style=\"height:133px; width:200px\" /><img alt=\"\" src=\"https://bcluwuk.com/upload/images/WhatsApp%20Image%202018-11-07%20at%2013.58.32%281%29.jpeg\" style=\"height:133px; margin-left:8px; margin-right:8px; width:200px\" /><img alt=\"\" src=\"https://bcluwuk.com/upload/images/WhatsApp%20Image%202018-11-07%20at%2013.58.32%282%29.jpeg\" style=\"height:133px; margin-left:8px; margin-right:8px; width:200px\" /></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n', '', '2018-11-07', '15:42:24', 'pelaksanaan-gathering-eksportir-dan-pembentukan-klinik-ekspor', 1);
