(1, 'Kantor Pengawasan Dan Pelayanan Bea Dan Cukai Tipe Madya Pabean C Luwuk', '', '', '', 'https://bcluwuk.com/upload/images/logo.png', 'https://bcluwuk.com/upload/images/logo.png', 'https://www.facebook.com/KantorBeaCukaiLuwuk', '#', '#', 'https://bcluwuk.com/upload/images/S__4513824.jpg', '', 'Kantor Pengawasan dan Pelayanan Bea dan Cukai Tipe Madya Pabean C Pratama Luwuk  adalah salah satu dari 104 Kantor Pengawasan dan Pelayanan Bea dan Cukai dibawah Direktorat Jenderal Bea dan Cukai – Kementerian Keuangan Republik Indonesia. Memiliki tugas dan fungsi pengawasan dan pelayanan di bidang kepabeanan dan cukai.\n\nSejak Desember 2016, Kantor Pengawasan dan Pelayanan Bea dan Cukai Tipe Pratama Luwuk berubah menjadi sebuah Kantor Modern dan berubah nama dari yang sebelumnya KPPBC Tipe Pratama Luwuk menjadi KPPBC Tipe Madya Pabean C Luwuk. Perubahan tersebut merupakan tuntutan  agar senantiasa berinovasi dan berkembang terkait tugas dan fungsi khususnya dalam hal memberikan pelayanan kepada pengguna jasa.', 'https://bcluwuk.com/web/news', 'Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget, tempor sit amet, ante. Donec eu libero sit amet quam egestas semper. Aenean ultricies mi vitae est. Mauris placerat eleifend leo. Quisque sit amet est et sapien ullamcorper pharetra.', '(0461) 21149', 'kppbc.luwuk@gmail.com', '-0.833622', '123.050401', 'Kantor Pengawasan Dan Pelayanan Bea Dan Cukai Tipe Madya Pabean C Luwuk', '');
